[[package]]
name = "botocore"
version = "1.20.53"
description = "Low-level, data-driven core of boto 3."
category = "main"
optional = false
python-versions = ">= 2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*, !=3.5.*"

[package.dependencies]
jmespath = ">=0.7.1,<1.0.0"
python-dateutil = ">=2.1,<3.0.0"
urllib3 = ">=1.25.4,<1.27"

[package.extras]
crt = ["awscrt (==0.10.8)"]

[[package]]
name = "botocore-stubs"
version = "1.20.94"
description = "Type annotations for botocore 1.20.94, generated by mypy-boto3-buider 4.18.2"
category = "dev"
optional = false
python-versions = ">=3.6"

[[package]]
name = "cattrs"
version = "1.10.0"
description = "Composable complex class support for attrs and dataclasses."
category = "main"
optional = true
python-versions = ">=3.7,<4.0"

[package.dependencies]
attrs = ">=20"

[[package]]
name = "certifi"
version = "2020.12.5"
description = "Python package for providing Mozilla's CA Bundle."
category = "dev"
optional = false
python-versions = "*"

[[package]]
name = "cfgv"
